                </div>
            </div>
            <img id="img-landing" src = {require('../../assets/g12.png').default }/> 
        </div> 
        
   
        </>
    )
    function SignIn(){
        return(
            <Modal >
                <ModalBody>
                    <div style={{color:'white'}}>Simple Modal with just ModalBody...</div>
                </ModalBody>
            </Modal>
        )
        }
    }
